    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments during the 1978 calendar year. The report begins with an
    introduction to the Refuge and information about weather conditions, habitat conditions,
    land acquisition activities, and the system status. Construction, maintenance, and
    wildfires are also described. Habitat management is covered; wilderness areas are
    discussed. The wildlife section of the report discusses endangered and threatened
    species, migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Field investigations, items of interest, and safety information
    are attached.",nt"license_title": "License Not Specified",nt"extras":
